centavos);
Exercicio de 2012  R$ 558.081,29 (quinhentos e cinquenta e oito mil, oitenta e um reais e vinte e nove centavos);
Exercicio de 2013  R$ 1.361.678,70 (um milhao trezentos e sessenta e um mil, seiscentos e setenta e oito 
reais e setenta centavos).

Exercicio de 2014  R$ 2.684.482,95 (dois milhoes seiscentos e oitenta e quatro mil, quatrocentos e oitenta e 
dois reais e noventa e cinco centavos);
Exercicio de 2015  R$ 2.793.103,65 (dois milhoes setecentos e noventa e tres mil, cento e tres reais e sessenta 
e cinco centavos);
Exercicio de 2016  R$ 1.396.551,83 (um milhao trezentos e noventa e seis mil, quinhentos e cinquenta e um 
reais e oitenta e tres centavos).

Dentre as acoes desenvolvidas no exercicio de 2013, destacam-se:
. Mapeamento dos processos organizacionais, visando orientar as acoes de gestao;
. Renovacao e licitacao de contratos administrativos de natureza continua; 
. Padronizacao e normatizacao dos procedimentos administrativos e financeiros;
. Adequacao orcamentaria com foco nos objetivos empresariais;
. Aplicacao, gerenciamento e fiscalizacao das receitas investidas em Pesquisa e Desenvolvimento (P&D);
. Reavaliacao do sistema de informatica com foco na melhoria empresarial;
. Estudo e avaliacao da transferencia das instalacoes da sede da empresa para local proximo do SIA, com melhor acesso ao cliente
CEB Distribuicao e as demais empresas parceiras do "Grupo CEB" - CEB Geracao, CEB Participacoes e CEB Holding,
melhorando as acomodacoes da Companhia, bem como visando a otimizacao de recursos e a reducao dos custos de
manutencao e deslocamento.

Firmar cada vez mais o papel de gerar e garantir cerca de 20% da energia consumida no DF;
. Realizacao de concurso publico para efetivacao de quadro proprio de pessoal;
. Aperfeicoamento constante da gestao, disseminando a cultura e valores de desen-
volvimento humano;
. Gestao junto aos orgaos reguladores no sentido de garantir a equalizacao tarifaria;
. Manter a busca permanente da qualidade e a transparencia em nossas decisoes;
. Qualificacao e aprimoramento da forca de trabalho;
. Contratacao de consultoria especializada na comercializacao de energia;

Instrucao de preenchimento do relatorio de atividades
 desenvolvidas pelo educador social voluntario
BLOCO 1 - IDENtIFICACAO DA UNIDADE ESCOLAR
1. Unidade escolar = registrar o nome da unidade escolar;
2.Endereco = registrar o endereco da unidade escolar
3. Municipio = Brasilia;
4. UF = DF.
5. Mes/ano = registrar o mes/ano de referencia de acordo com as datas registradas no Bloco 3.
BLOCO 2 - IDENtIFICACAO DO EDUCADOR SOCIAL VOLUNtARIO
6. Nome = nome completo do educador Social;
7. CPF = numero do CPF do educador Social;
8. Ressarcimento = marca com X no (SIM) se atividade desenvolvida pelo educador social 
voluntario for ressarcida;
9. Telefone = numero do telefone do educador social; - (fixo ou celular)
BLOCO 3 - AtIVIDADE REALIZADA
10. Data do mes = registrar a data (apenas o dia) da atividade realizada;
11. Dia da Semana = registrar qual o dia da semana em que a data se refere (segunda-feira / 
terca-feira (...));
12. Horario = registra o horario de inicio ate o horario de encerramento das atividades;
13. Nome da atividade = registrar o titulo da atividade que sera desenvolvida naquele dia;
14. Atividade realizada = descrever detalhes de como sera o desenvolvimento da atividade;
15. Assinatura = refere-se a assinatura do educador social voluntario; (pode ser rubrica)
OBS = A unidade escolar devera zelar para que o preenchimento do relatorio seja de fato feito todos 
os dias. As datas deverao estar em consonancia com as datas registradas no Recibo - (Anexo IV). 
16. Numero de estudantes atendidos no mes = a Unidade escolar ira informar o quantitativo de 
alunos que foram atendidos naquele mes;
17. Valor do ressarcimento = o valor do ressarcimento sera calculado de acordo com o quantitativo 
de dias de atividades realizadas e cumpridas pelo educador social voluntario X o valor diario de 
R$ 22,00; (preenchido pela UE)
18. Cheque nominal n.o = informar o numero do cheque em que o educador social voluntario - o 
numero devera estar em consonancia com o numero do cheque constante no recibo (preenchido 
pela UEx da CRE);
BLOCO 4 - AUtENtICACAO
Local e data = preencher com a data do ultimo dia util do mes em que as atividades foram 
realizadas
Assinatura do Educador Social Voluntario = assinatura devera ser legivel e por extenso
CERtIFICACAO
A certificacao tem como objetivo atestar a realizacao das atividades conforme as diretrizes da 
Educacao em Tempo Integral e com os criterios e atividades definidas na Portaria n.o 43/14.
Data = registrar o ultimo dia de atividade do mes, ou, primeiro dia util subsequente;
Assinatura do responsavel pelo acompanhamento e orientacao das atividades realizadas pelo 
Educador Social na unidade escolar;
Se as atividades realizadas pelo educador social voluntario for de carater pedagogico - a assinatura 
devera ser do coordenador pedagogico ou supervisor pedagogico;
Se as atividades realizadas pelo educador social voluntario forem de carater administrativo, a 
assinatura devera ser do supervisor administrativo. Na ausencia deste, o atesto sera do vice-diretor 
da unidade escolar (com carimbo).

